import React, { useContext, useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './routes/Home';
import Contacto from './routes/Contact';
import Favoritos from './routes/Favs';
import Detail from './routes/Detail';
import './index.css';

// Importa el contexto global de tema desde global.context.js
import { GlobalContextProvider } from './components/utils/global.context';

function App() {
  return (
    <GlobalContextProvider>
      <Router>
        <div className="App">
          <Navbar />
          <Routes>
            <Route path="/home" element={<Home />} />
            <Route path="/contacto" element={<Contacto />} />
            <Route path="/favs" element={<Favoritos />} />
            <Route path="/dentist/:id" element={<Detail />} />
          </Routes>
          <Footer />
        </div>
      </Router>
    </GlobalContextProvider>
  );
}

export default App;
